import React from 'react'
import * as S from './purchase.style'

export default function Purchase() {
  return (
    <div className="container">
      <S.PurchaseWrapper>
        <S.PurchaseProfile></S.PurchaseProfile>
        <S.PurchaseContent></S.PurchaseContent>
      </S.PurchaseWrapper>
    </div>
  )
}
